import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
var Sql_select = require("../sql/Sql_select.js");

function Create() {
  const location = useLocation();

  const pre_data = location.state as {
    id: string;
    pw: string;
    pw_check: string;
    name: string;
    phone: string;
    SSN: string;
    email: string;
  };
  alert(pre_data.id);

  const [state, setState] = useState({
    id: pre_data.id,
    pw: pre_data.pw,
    pw_check: pre_data.pw_check,
    name: pre_data.name,
    phone: pre_data.phone,
    SSN: pre_data.SSN,
    email: pre_data.email,
  });

  const navigate = useNavigate();

  const navigateToBack = () => {
    navigate("/");
  };

  function handleChange(e: any) {
    setState({
      ...state,
      [e.target.name]: e.target.value,
    });
  }

  const pre_id_Check = () => {
    if (state.id === "") {
      alert("아이디를 입력해주세요.");
    }
    navigate("/create", {
      state: {
        id: `${state.id}`,
        pw: `${state.pw}`,
        pw_check: `${state.pw_check}`,
        name: `${state.name}`,
        phone: `${state.phone}`,
        SSN: `${state.SSN}`,
        email: `${state.email}`,
      },
    });
  };

  return (
    <div className="box">
      <form className="create_form">
        <fieldset className="inner_form">
          <legend className="title">회원가입</legend>
          <div className="id_title">
            <span className="subtitle1">아이디 : </span>
            <div className="id_section">
              <input
                type="text"
                name="id"
                className="id"
                value={state.id}
                placeholder="아이디를 입력해주세요"
                onChange={handleChange}
              ></input>
              <button className="id_check_btn" onClick={pre_id_Check}>
                중복
              </button>
            </div>
          </div>
          <div>
            <span className="subtitle">비밀번호 : </span>
            <input
              type="password"
              name="pw"
              className="pw"
              value={state.pw}
              placeholder="비밀번호를 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle">비밀번호 확인 : </span>
            <input
              type="password"
              name="pw_check"
              className="pw"
              value={state.pw_check}
              placeholder="비밀번호를 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle1">이름 : </span>
            <input
              type="text"
              name="name"
              className="name"
              value={state.name}
              placeholder="이름을 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle">전화번호 : </span>
            <input
              type="text"
              name="phone"
              className="phone"
              value={state.phone}
              placeholder="전화번호를 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle">주민번호 : </span>
            <input
              type="text"
              name="SSN"
              className="SSN"
              value={state.SSN}
              placeholder="주민번호를 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
          <div>
            <span className="subtitle">e-mail : </span>
            <input
              type="text"
              name="email"
              className="email"
              value={state.email}
              placeholder="이메일을 입력해주세요"
              onChange={handleChange}
            ></input>
          </div>
        </fieldset>
        <button className="create_btn" onClick={navigateToBack}>
          확인
        </button>
      </form>
    </div>
  );
}

export default Create;
